sources.sass/dash.scss:
$value : 200px;
$mutedText: gray;
$selectColor: red;
$bright: white;

#user-sidenav-trigger{
	background-color: transparent;
	color: $bright;

	i{
		position: relative;
		top: 8px
	}
}

#user-sidenav-trigger>i:hover{
	transform: scale(1.2,1.2);
}

.avatarbox{
	.avatar{
		max-width: $value;
		max-height: $value;
		position: relative;

		img{
			width: 100%;
			height: 100%;
			position: relative;
			bottom: 0px;
		}
	}

	.greendot{
		margin-right: 3px;
		margin-bottom: 5%;
		width: 3px;
	}

	h3{
		font-weight: 800;
		font-size: 2em;
		position: relative;
	}

	.wallet{
		font-size: 0.9em;
		color: $mutedText;
	}

	.amount{
		font-size: 4em;
		font-weight: 800;
		margin-top: -10px;

		img{
			width: 10%;
			margin-left: 5px;
			margin-bottom: 5%;
		}
	}

	select{
		padding: 5px;
		background-color: $mutedText;
		border: 0px solid transparent;
		width: 40%;
		text-align: center;
	}

	input{
		background-color: transparent !important;
		border-radius: 10px;
		padding-left: 1em;
		color: $bright;
		border: 1px solid $bright;
	}

	input:last-child{
		background-color: $bright !important;
	}
}

.dash-top-form{
	select{
		height: 3em;
		background-color: $selectColor;
		border: 0px solid transparent;
		color: $bright;
	}
	select:active{
		background-color: $selectColor;
	}
	select:visited{
		background-color: $selectColor;
	}
	select:hover{
		background-color: $selectColor;
	}

	label[for="cash"], label[for="buy"]{
		height: 3em;
		background-color: $selectColor;
		border: 0px solid transparent;
		padding-top: 10px;
		color: $bright;
		margin-left: 15px
	}
	#max span, #min span{
		height: 4em;
		line-height: 3em;
		background-color: $selectColor;
		border: 0px solid transparent;
		padding: 15px 10px;
		border-radius: 5px;
		color: $bright;
	}
	input{
		margin-right: 15px;
		margin-left: 5px;
		height: 3em;
	}
}

.chatbox{
	width: 100%;
	height: 100%;
	border: 2px solid $bright;

	.chatroom{
		width: 100%;
		height: 25em;
		background-color: $bright;
	}

	.chatbar{
		width: 93%;
		height: 2em;
		background-color: $bright;
		position: relative;
		margin-right: 1%;
		z-index: 2000;
		margin-top: 5px;
		display: inline-block;
	}

	a.btn{
		position: absolute;
		font-size: 0.8em;
	}


}

.dash-box{
	margin-top: 50px;

	.line2{
		width: 80%;
		height: 2px;
		border: 2px solid $bright;
		margin-top: 10em;
		margin-bottom: 5em; 
		position: relative;
	}

	img{
		position: relative;
		bottom: 50%;
		margin-right: 12%;
		width: 15%;
	}
	img:last-child{
		margin-right: 0%;
	}
}
